"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Gestational diabetes (diabetes that starts during pregnancy) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/gestational-diabetes-diabetes-that-starts-during-pregnancy-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H469648842\">",
"      <span class=\"h1\">",
"       What is gestational diabetes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Gestational diabetes, like &ldquo;regular&rdquo; diabetes, is a disorder that disrupts the way your body uses sugar.",
"     </p>",
"     <p>",
"      All the cells in your body need sugar to work normally. Sugar gets into the cells with the help of a hormone called insulin. If there is not enough insulin, or if the body stops responding to insulin, sugar builds up in the blood. That is what happens to people with diabetes.",
"     </p>",
"     <p>",
"      Gestational diabetes is a form of diabetes that affects some women when they are pregnant. It happens because pregnancy increases the body&rsquo;s need for insulin, but the body cannot always make enough.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648849\">",
"      <span class=\"h1\">",
"       What does gestational diabetes do to a woman and her baby?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It can make the baby get too big (heavier than 9 pounds). That is a problem, because a big baby can get hurt if it cannot fit easily through the vagina. A big baby can also damage his or her mother&rsquo;s body during delivery. Sometimes, the baby will not fit and the mother has to have a c-section (surgery to get the baby out).",
"     </p>",
"     <p>",
"      Gestational diabetes also increases the risk that a woman will have a life-threatening problem during pregnancy called preeclampsia. (Preeclampsia causes high blood pressure, among other things.)",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648856\">",
"      <span class=\"h1\">",
"       Will I get gestational diabetes during my pregnancy?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It is hard to predict which women will get gestational diabetes. But some women are more likely to get it than others. You are more likely to get gestational diabetes if you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Had it before",
"       </li>",
"       <li>",
"        Are overweight",
"       </li>",
"       <li>",
"        Have diabetes in your family",
"       </li>",
"       <li>",
"        Are older than 25",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648863\">",
"      <span class=\"h1\">",
"       Will I be tested for gestational diabetes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. All pregnant women are tested for gestational diabetes.",
"     </p>",
"     <p>",
"      Most women should be tested when they are about 6 or 7 months pregnant. (That&rsquo;s the same as 24 to 28 weeks pregnant.) But women at high risk for diabetes may need to be tested earlier in pregnancy.",
"     </p>",
"     <p>",
"      There are a few ways to test for diabetes. A common way is to have you drink a special, sweet drink. Then, an hour or more later, your doctor or nurse will take some blood. That way he or she can see how high your blood sugar gets after you eat sugar.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648870\">",
"      <span class=\"h1\">",
"       How is gestational diabetes treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To treat your gestational diabetes, you will need to check your blood sugar often. This is something you can learn how to do on your own with an easy-to-use machine. Most women can control their blood sugar level by changing their diet. Some women also need insulin shots or other diabetes medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648877\">",
"      <span class=\"h1\">",
"       How should I change my diet?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A registered dietitian can tell you how to change your diet. Each woman is a little different, so there is no single diet that is right for everyone. Even so, most women should:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Avoid sweets and fatty foods",
"       </li>",
"       <li>",
"        Choose bread and rice made with whole grains",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648884\">",
"      <span class=\"h1\">",
"       Should I exercise?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You do not need to exercise to treat gestational diabetes. But being active will help control your blood sugar. If you already exercise, keep doing what you have been doing. If you have not been exercising and want to start, ask your doctor or nurse what kind of activity is safe for you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648891\">",
"      <span class=\"h1\">",
"       How often do I need to see the doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Women with gestational diabetes need to see the doctor or nurse more often than other pregnant women. How often you go will depend on how you are doing at each visit, and on whether you use insulin. During these visits, the doctor or nurse will:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Check on your baby",
"       </li>",
"       <li>",
"        Ask about your diet",
"       </li>",
"       <li>",
"        Make sure your blood sugar levels are where they should be",
"       </li>",
"       <li>",
"        Adjust your dose of insulin (if you use insulin)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648898\">",
"      <span class=\"h1\">",
"       Can I have a normal delivery?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your blood sugar levels have been close to normal, chances are good that you will have a normal delivery. During delivery, your doctor or nurse will keep checking your blood sugar to make sure that it does not get too high.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648905\">",
"      <span class=\"h1\">",
"       What happens after I give birth?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your diabetes will probably go away and your blood sugar will probably go back to normal. If you were taking insulin, you probably will not need it anymore. Even so, your doctor or nurse should check your blood sugar to make sure your levels get back to normal and stay that way. Women who have gestational diabetes are at very high risk of getting &ldquo;regular&rdquo; diabetes later in life. You should get checked for diabetes every few years for the rest of your life.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H469648912\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?32/44/33475?source=see_link\">",
"       Patient information: Type 2 diabetes (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?40/59/41906?source=see_link\">",
"       Patient information: Nutrition before and during pregnancy (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?32/13/32979?source=see_link\">",
"       Patient information: Gestational diabetes mellitus (Beyond the Basics)",
"      </a>",
"     </p>",
