"if(Age >= 13 && Age < 14){L = 0.0563; M = 9.8749; S = 0.10949;};",
"if(Age >= 14 && Age < 15){L = 0.0487; M = 10.0953; S = 0.10976;};",
"if(Age >= 15 && Age < 16){L = 0.0413; M = 10.3108; S = 0.11007;};",
"if(Age >= 16 && Age < 17){L = 0.0343; M = 10.5228; S = 0.11041;};",
"if(Age >= 17 && Age < 18){L = 0.0275; M = 10.7319; S = 0.11079;};",
"if(Age >= 18 && Age < 19){L = 0.0211; M = 10.9385; S = 0.11119;};",
"if(Age >= 19 && Age < 20){L = 0.0148; M = 11.1430; S = 0.11164;};",
"if(Age >= 20 && Age < 21){L = 0.0087; M = 11.3462; S = 0.11211;};",
"if(Age >= 21 && Age < 22){L = 0.0029; M = 11.5486; S = 0.11261;};",
"if(Age >= 22 && Age < 23){L = -0.0028; M = 11.7504; S = 0.11314;};",
"if(Age >= 23 && Age < 24){L = -0.0083; M = 11.9514; S = 0.11369;};",
"if(Age >= 24 && Age < 25){L = -0.0137; M = 12.1515; S = 0.11426;};",
"}",
"Z_Score =  (power((Weight / M), L) - 1) / (L * S);",
"",
"if (doCalc) Z_Score_param.value = fixDP(Z_Score, dp);",
"",
"",
"",
"Percentile =  ZtoPercentile(Z_Score);",
"",
"if (doCalc) Percentile_param.value = fixDP(Percentile, dp);",
"",
"",
"",
"",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.WHOInfantWeightForAge_form){",
"",
"if (Age_param.value && Age < 0) {",
"Age = 0;",
"Age_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Age is 0 mo.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Age_param.value && Age > 23.99) {",
"Age_param.value = \"\";",
"clrResults();",
"Age = 0;",
"doCalc = false;",
"alert(\"The maximum value for Age is 23.99 mo.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Weight_param.value && Weight < 0.5) {",
"Weight = 0;",
"Weight_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Weight is 0.5 kg.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Weight_param.value && Weight > 100) {",
"Weight_param.value = \"\";",
"clrResults();",
"Weight = 0;",
"doCalc = false;",
"alert(\"The maximum value for Weight is 100 kg.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.WHOInfantWeightForAge_form){",
"",
"Z_Score_param.value = '';",
"Percentile_param.value = '';",
"",
"",
"}",
"",
"}",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
