"   <div class=\"block pha drugH1Div\" id=\"F160727\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Competes with histamine for H",
"     <sub>",
"      1",
"     </sub>",
"     -receptor sites on effector cells in the gastrointestinal tract, blood vessels, and respiratory tract; blocks chemoreceptor trigger zone, diminishes vestibular stimulation, and depresses labyrinthine function through its central anticholinergic activity",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F160739\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     Dimenhydrinate is a salt of two drugs: Diphenhydramine (53% to 55.5%) and 8-chlorotheophylline (44% to 47%). Refer to DiphenhydrAMINE (Systemic) monograph.",
"    </p>",
"   </div>",
