"         Pheochromocytoma",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Poorly differentiated&nbsp;neuroendocrine carcinoma (many primary sites)",
"        </p>",
"        <p>",
"         Extrapulmonary small cell carcinoma (many primary sites)",
"        </p>",
"        <p>",
"         Merkel cell tumor of the skin&nbsp;skin",
"        </p>",
"        <p>",
"         Neuroblastoma, adrenal",
"        </p>",
