var title_f11_46_12012="Diagnostic criteria PCOS";
var content_f11_46_12012=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F86810&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F86810&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Proposed diagnostic criteria for polycystic ovary syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        NIH consensus criteria 1990",
"        <sup>",
"         [1]",
"        </sup>",
"        <br/>",
"        (All required)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Rotterdam criteria 2003*",
"        <sup>",
"         [2]",
"        </sup>",
"        <br/>",
"        (Two out of three required)",
"       </td>",
"       <td class=\"subtitle1\">",
"        AES definition 2008",
"        <sup>",
"         [3]",
"        </sup>",
"        <br/>",
"        (All required)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Menstrual irregularity due to oligo- or anovulation",
"       </td>",
"       <td>",
"        Oligo- or anovulation",
"       </td>",
"       <td>",
"        Clinical and/or biochemical signs of hyperandrogenism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clinical and/or biochemical signs&nbsp;of hyperandrogenism",
"       </td>",
"       <td>",
"        Clinical and/or biochemical signs of hyperandrogenism",
"       </td>",
"       <td>",
"        Ovarian dysfunction &ndash; oligo-anovulation and/or polycystic ovaries on ultrasound",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Exclusion of other disorders: NCCAH, androgen-secreting tumors",
"       </td>",
"       <td>",
"        Polycystic ovaries (by ultrasound)",
"       </td>",
"       <td>",
"        Exclusion of other androgen excess or ovulatory disorders",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     NIH: National Institutes of Health; AES: Androgen Excess Society; NCCAH: nonclassic congenital adrenal hyperplasia; PCOS: polycystic ovary syndrome.",
"     <br/>",
"     * Rotterdam criteria based upon a 2003 concensus meeting held in Rotterdam (European Society of Human Reproduction and Embryology/American Society of Reproductive Medicine consensus workshop group).",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Zawadski JK, Dunaif A. Diagnostic criteria for polycystic ovary syndrome: Towards a rational approach. In: Polycystic Ovary Syndrome (Current Issues in Endocrinology and Metabolism), Dunaif A, Givens JR, Haseltine FP, Merriam GE (Eds), Blackwell Scientific Inc., Boston 1992. p.377.",
"      </li>",
"      <li>",
"       Rotterdam ESHRE/ASRM-Sponsored PCOS consensus workshop group. Revised 2003 consensus on diagnostic criteria and long-term health risks related to polycystic ovary syndrome (PCOS). Hum Reprod 2004; 19:41.",
"      </li>",
"      <li>",
"       Azziz R, Carmina E, Dewailly D, et al. The Androgen Excess and PCOS Society criteria for the polycystic ovary syndrome: the complete task force report. Fertil Steril 2009; 91:456.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
