var title_f11_46_12013="NCHS vs WHO growth curves";
var content_f11_46_12013=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F80048&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F80048&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Comparison of National Center for Health Statistics and World Health Organization growth charts for children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Year published",
"       </td>",
"       <td class=\"subtitle1\">",
"        NCHS/CDC",
"       </td>",
"       <td class=\"subtitle1\">",
"        WHO",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        2000",
"       </td>",
"       <td class=\"subtitle2\">",
"        2006",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Population(s) from which curves were derived",
"       </td>",
"       <td>",
"        General US population (data from the National Health and Nutrition Survey between 1970s and 1990s); includes infants and children from a variety of socioeconomic and ethnic groups",
"       </td>",
"       <td>",
"        Multicentre Growth Reference study (Brazil, Ghana, India, Norway, Oman, United States); population chosen to reflect growth under ideal conditions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Age groups",
"       </td>",
"       <td>",
"        <p>",
"         0 to 36 months (cross-sectional data; includes both breastfed and formula-fed infants)",
"        </p>",
"        <p>",
"         2 to 20 years (cross-sectional data)",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         0 to 2 years (longitudinal data); infants were exclusively/predominantly breastfed for 4 to 6 months and continued to breastfeed until at least 12 months",
"        </p>",
"        <p>",
"         2 to 5 years (cross-sectional data)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Estimated prevalence of overweight in US children*&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 to 23 months",
"       </td>",
"       <td>",
"        9.6 percent",
"       </td>",
"       <td>",
"        7.5 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        24 to 59 months",
"       </td>",
"       <td>",
"        9.6 percent",
"       </td>",
"       <td>",
"        8.5 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Estimated prevalence of underweight in US children*&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"3\">",
"        Weight-for-age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 to 23 months",
"       </td>",
"       <td>",
"        6.8 percent",
"       </td>",
"       <td>",
"        2.0 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        24 to 59 months",
"       </td>",
"       <td>",
"        3.8 percent",
"       </td>",
"       <td>",
"        0.8 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"3\">",
"        Weight-for-height",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 to 23 months",
"       </td>",
"       <td>",
"        4.0 percent",
"       </td>",
"       <td>",
"        0.8 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        24 to 59 months",
"       </td>",
"       <td>",
"        3.0 percent",
"       </td>",
"       <td>",
"        0.5 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Estimated prevalence of shortness in US children*&loz;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 to 23 months",
"       </td>",
"       <td>",
"        4.9 percent",
"       </td>",
"       <td>",
"        5.2 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        24 to 59 months",
"       </td>",
"       <td>",
"        2.9 percent",
"       </td>",
"       <td>",
"        3.1 percent",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     NCHS: National Center for Health Statistics; CDC: Centers for Disease Control; WHO: World Health Organization.",
"     <br>",
"      * Using data from the National Health and Nutrition Examination Survey (1999-2004).",
"      <br>",
"       &bull; On the NCHS curves, overweight is defined by weight-for-height &gt;95th percentile for children 0 to 23 months and BMI &gt;95th percentile for children 24 to 59 months. On the WHO curves,&nbsp;overweight is defined&nbsp;by weight-for-height &gt;97.7th percentile for children 0 to 23 months and BMI &gt;97.7th percentile for children 24 to 59 months.",
"       <br>",
"        &Delta; On the NCHS curves, underweight is defined by weight-for-age or weight-for-height &lt;5th percentile. On the WHO curves, underweight is defined&nbsp;by weight-for-age or weight-for-height &lt;2.3rd percentile.",
"        <br>",
"         &loz; On the NCHS curve, shortness defined by height-for-age &lt;5th percentile. On the WHO curve, shortness is defined&nbsp;by height-for-age&nbsp;&lt;2.3rd percentile.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data for prevalence estimates from: Mei Z, Ogden CL, Flegal KM, Grummer-Strawn LM. Comparison of the prevalence of shortness, underweight, and overweight among US children aged 0 to 59 months by using the CDC 2000 and the WHO 2006 growth charts. J Pediatr 2008; 153:622.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
