var title_f11_46_12014="Monoclonal gammopathies disease definitions";
var content_f11_46_12014=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F67431&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F67431&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Disease definitions for the monoclonal gammopathies: MGUS and related disorders",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Type of monoclonal gammopathy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Premalignancy with low risk of progression (1 to 2 percent per year)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Premalignancy with high risk of progression (10 percent per year)",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Malignancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         IgG and IgA (non-IgM)",
"        </strong>",
"        *",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Non-IgM MGUS",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          All criteria must be met:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          Serum monoclonal protein &lt;3 g/dL",
"         </li>",
"         <li>",
"          Clonal BM plasma cells &lt;10 percent",
"         </li>",
"         <li>",
"          Absence of end-organ damage such as CRAB that can be attributed to the PCPD",
"         </li>",
"        </ol>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Smoldering MM",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          Both criteria must be met:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          Serum monoclonal protein (IgG or IgA) &ge;3 g/dL and/or clonal BM plasma cells &ge;10 percent",
"         </li>",
"         <li>",
"          Absence of end-organ damage such as CRAB that can be attributed to a PCPD",
"         </li>",
"        </ol>",
"       </td>",
"       <td colspan=\"2\">",
"        <p>",
"         <strong>",
"          MM",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          All criteria must be met except as noted:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          Clonal BM plasma cells &ge;10 percent",
"         </li>",
"         <li>",
"          Presence of serum and/or urinary monoclonal protein (except in patients with true nonsecretory MM)",
"         </li>",
"         <li>",
"          Evidence of end-organ damage that can be attributed to the underlying PCPD, specifically one or more of the following:",
"         </li>",
"        </ol>",
"        <ul>",
"         <li>",
"          Hypercalcemia: serum calcium &ge;11.5 mg/dL",
"         </li>",
"         <li>",
"          Renal insufficiency: serum creatinine &gt;2 mg/dL or estimated creatinine clearance &lt;40 mL/min",
"         </li>",
"         <li>",
"          Anemia: normochromic, normocytic with hemoglobin &gt;2 g/dL below lower limit of normal or hemoglobin &lt;10 g/dL",
"         </li>",
"         <li>",
"          Bone lesions: lytic lesions or severe osteopenia attributed to a PCPD or pathologic fractures",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         IgM",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          IgM MGUS",
"         </strong>",
"         &Delta;",
"        </p>",
"        <p>",
"         <em>",
"          All criteria must be met:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          Serum monoclonal protein &lt;3 g/dL",
"         </li>",
"         <li>",
"          Clonal BM lymphoplasmacytic cells &lt;10 percent",
"         </li>",
"         <li>",
"          Absence of end-organ damage such as anemia, constitutional symptoms, hyperviscosity, lymphadenopathy, or hepatosplenomegaly that can be attributed to the underlying lymphoproliferative disorder",
"         </li>",
"        </ol>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Smoldering WM",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          Both criteria must be met:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          Serum IgM monoclonal protein &ge;3 g/dL and/or BM lymphoplasmacytic infiltration &ge;10 percent",
"         </li>",
"         <li>",
"          No evidence of anemia, constitutional symptoms, hyperviscosity, lymphadenopathy, or hepatosplenomegaly that can be attributed to the underlying lymphoproliferative disorder",
"         </li>",
"        </ol>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          WM",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          All criteria must be met:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          IgM monoclonal gammopathy (regardless of size of M protein)",
"         </li>",
"         <li>",
"          &ge;10 percent BM lymphoplasmacytic infiltration (usual intertrabecular) by small lymphocytes that exhibit plasmacytoid or plasma cell differentiation and a typical immunophenotype (eg, surface IgM",
"          <sup>",
"           +",
"          </sup>",
"          , CD5",
"          <sup>",
"           &plusmn;",
"          </sup>",
"          , CD10",
"          <sup>",
"           -",
"          </sup>",
"          , CD19",
"          <sup>",
"           +",
"          </sup>",
"          , CD20",
"          <sup>",
"           +",
"          </sup>",
"          , CD23",
"          <sup>",
"           -",
"          </sup>",
"          ) that satisfactorily excludes other lymphoproliferative disorders including chronic lymphocytic leukemia and mantle cell lymphoma",
"         </li>",
"         <li>",
"          Evidence of anemia, constitutional symptoms, hyperviscosity, lymphadenopathy, or hepatosplenomegaly that can be attributed to the underlying lymphoproliferative disorder",
"         </li>",
"        </ol>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          IgM myeloma",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          All criteria must be met:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          Symptomatic monoclonal PCPD characterized by a serum IgM monoclonal protein regardless of size",
"         </li>",
"         <li>",
"          Presence of &ge;10 percent plasma cells on BM biopsy",
"         </li>",
"         <li>",
"          Presence of lytic bone lesions related to the underlying plasma cell disorder and/or translocation t(11:14) on FISH",
"         </li>",
"        </ol>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Light chain",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Light chain MGUS",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          All criteria must be met:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          Abnormal FLC ratio (&lt;0.26 or &gt;1.65)",
"         </li>",
"         <li>",
"          Increased level of the appropriate involved light chain (increased &kappa; FLC in patients with ratio &gt;1.65 and increased &lambda; FLC in patients with ratio &lt;0.26)",
"         </li>",
"         <li>",
"          No immunoglobulin heavy chain expression on immunofixation",
"         </li>",
"         <li>",
"          Clonal BM plasma cells &lt;10 percent",
"         </li>",
"         <li>",
"          Absence of end-organ damage such as CRAB that can be attributed to the PCPD",
"         </li>",
"        </ol>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Idiopathic Bence Jones proteinuria",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          All criteria must be met:",
"         </em>",
"        </p>",
"        <ol>",
"         <li>",
"          Urinary monoclonal protein on urine protein electrophoresis &ge;500 mg/24 h and/or clonal BM plasma cells &ge;10 percent",
"         </li>",
"         <li>",
"          No immunoglobulin heavy chain expression on immunofixation",
"         </li>",
"         <li>",
"          Absence of end-organ damage such as CRAB that can be attributed to the PCPD",
"         </li>",
"        </ol>",
"       </td>",
"       <td colspan=\"2\">",
"        <p>",
"         <strong>",
"          Light chain MM",
"         </strong>",
"         &Delta;",
"        </p>",
"        <p>",
"         Same as MM except no evidence of immunoglobulin heavy chain expression on immunofixation",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     BM: bone marrow; CRAB: hyper",
"     <strong>",
"      c",
"     </strong>",
"     alcemia,",
"     <strong>",
"      r",
"     </strong>",
"     enal insufficiency,",
"     <strong>",
"      a",
"     </strong>",
"     nemia, and",
"     <strong>",
"      b",
"     </strong>",
"     one lesions; FISH: fluorescent in situ hybridization; FLC: free light chain; MGUS: monoclonal gammopathy of undetermined significance; MM: multiple myeloma; PCPD: plasma cell proliferative disorder; WM: Waldenstr&ouml;m macroglobulinemia.",
"     <br>",
"      * Occasionally, patients with IgD and IgE monoclonal gammopathies have been described and will be considered part of this category as well.",
"      <br>",
"       &Delta; Note that conventionally IgM MGUS is considered a subtype of MGUS, and similarly light chain MM is considered a subtype of MM. Unless specifically distinguished, when the terms MGUS and MM are used in general, they include IgM MGUS and light chain MM, respectively.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Rajkumar SV, Kyle RA, Buadi FK. Advances in the diagnosis, classification, risk stratification, and management of monoclonal gammopathy of undetermined significance: implications for recategorizing disease entities in the presence of evolving scientific evidence. Mayo Clin Proc 2010; 85:945. Copyright &copy; 2010 Quadrant HealthCom, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
